import axios from "axios";
import React, { lazy, Suspense, useEffect, useState } from "react";
import { IShipping } from "./interface";
import Pagination from "./Pagination";

const Coin: React.FC = () => {
  const [page, setPage] = useState(1);
  const [totalPages, setTotalPages] = useState(10);
  const [coinsData, setCoinsData] = useState<IShipping[]>([]);

  const handlePrevPage = (prevPage: number) => {
    setPage((prevPage) => prevPage - 1);
  };

  const handleNextPage = (nextPage: number) => {
    console.log(nextPage);
    setPage((nextPage) => nextPage + 1);
  };

  useEffect(() => {
    console.log("effct");
    let token = localStorage.getItem("id_token");
    const fetchData = async () => {
      console.log(localStorage.getItem("id_token"));
      let requestInstance = axios.create({
        headers: {
          Authorization: `${token}`,
        },
      });
      try {
        const response = await requestInstance.get(
          `http://localhost:8080/api/user/shipping?page=${page}`
        );
        setCoinsData(response.data.data.data);
        setTotalPages(totalPages);
        console.log(
          response.data.data.data,
          "111111111111111111111111111111111111111111"
        );
      } catch (error) {
        console.log(error);
      }
    };
    console.log(
      coinsData,
      "===================================================="
    );

    fetchData();
  }, [page]);
  return (
    <>
      <div className="d-flex flex-warp my-4 shadow-lg p-3 mb-5 bg-body rounded">
        <div className="mx-1 my-2 flex-fill align-items-center">
          <label className="m-0 me-2">Show</label>

          <select
            onChange={handleChangeSelect}
            defaultValue="THIS_MONTH"
            name="show"
            id="show"
            className="form-select"
          >
            <option value="LAST_10_TRX">Last 10 transactions</option>
            <option value="THIS_MONTH">This month</option>
            <option value="LAST_MONTH">Last month</option>
            <option value="THIS_YEAR">This year</option>
            <option value="LAST_YEAR">Last year</option>
          </select>
        </div>
        <div className="mx-1 my-2">
          <label htmlFor="sortBy" className="m-0 me-2">
            Sort By
          </label>
          <select
            name="sortBy"
            id="sortBy"
            className="form-select"
            // onChange={handleChangeSelect}
          >
            <option value="DATE">Date</option>
            <option value="AMOUNT">Amount</option>
          </select>
        </div>
        <div className="mx-1 my-2">
          <label htmlFor="sortBy" className="m-0 me-2">
            Order
          </label>
          <select
            name="sort"
            id="sort"
            className="form-select"
            // onChange={handleChangeSelect}
          >
            <option value="DESC">Descending</option>
            <option value="ASC">Ascending</option>
          </select>
        </div>
        <div className="mx-1 my-2">
          <label htmlFor="sortBy" className="m-0 me-2">
            Search By Shipping Status
          </label>
          <input
            type="text"
            name="search"
            placeholder="Search..."
            // onChange={handleChangeInput}
            className="form-control"
          />
        </div>
      </div>
      <table
        className="table table-striped table-bordered tabel-hover"
        width="80%"
      >
        <thead>
          <tr>
            <th>ID</th>
            <th>Size</th>
            <th>Category</th>
            <th>Add On</th>
          </tr>
        </thead>
      </table>
      {coinsData.map((coin) => {
        return (
          <tr id={String(coin.id)} key={coin.id}>
            <td>{coin.id} </td>
            <td>{coin.size.name} </td>
            <td>{coin.category.name} </td>
            <td>{coin.add_on.name} </td>
          </tr>
        );
      })}

      <Pagination
        totalPages={totalPages}
        currentPage={page}
        handlePrevPage={handlePrevPage}
        handleNextPage={handleNextPage}
      />
    </>
  );
};

export default Coin;
